import React from 'react';
import Info from "../Info/Info";
import ImageSlider from "../ImageSlider/ImageSlide.jsx";

import './login.css';

const Login = () => {
  return (
    <>
    
    <div className='info__container'>
    <Info/>
    </div>

    <div className='imageslider__container'>
    <ImageSlider/>
    </div>
    </>
  )
}

export default Login
